const Header = (props) => {
  return (
    <div>
        <h1>{props.course}</h1>
    </div>
  )
}
const Content = (props) => {
  return (
    <div>
      <Part contentPart={props.parts[0].name} excercisePart={props.parts[0].exercises} />
      <Part contentPart={props.parts[1].name} excercisePart={props.parts[1].exercises} />
      <Part contentPart={props.parts[2].name} excercisePart={props.parts[2].exercises} />
    </div>
  )
}
const Part = (props) => {
  return (
    <div>
       <p>{props.contentPart} {props.excercisePart}</p>
    </div>
  )
}
const Total = (props) => {
  return (
    <div>
        <p>Number of exercises {props.part1x+ props.part2x+ props.part3x}</p>
    </div>
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const parts = [
  {
    name: 'Fundamentals of React',
    exercises: 10
  },
  {
    name: 'Using props to pass data',
    exercises: 7
  },
  {
    name: 'State of a component',
    exercises: 14
  },
]

  return (
    <div>
        <Header course={course}/>
        <Content parts={parts}/>
        <Total part1x={parts[0].exercises} part2x={parts[1].exercises} part3x={parts[2].exercises}/>
    </div>
  )
}

export default App
